import styled from "@emotion/styled";
import { Button } from "@mui/material";
const style = styled(Button)(({ theme }) => ({
  backgroundColor: "#1D9BF0",
}));

const StyledButton = () => {
  return <style></style>;
};

export default StyledButton;
